My name is Vitaly Biryuchkov and I am sure that I will be a valuable addition to your successful project as an IT Business Analyst.

I have professional experience of more than 15 years in management, in such areas as IT, sales, marketing, etc., with 12+ years in banking, accomplishing more than 15 projects.

In a nutshell, IT Business Analyst - is a person who identifies problems of a business, determines goals, sets tasks, collects data, analyzes received information and, considering all the available factors, offers the best suitable solution that meets the needs of the client and brings maximum benefit into a particular case.

So, I will be of service to you to:

- Prioritize tasks of a project backlog and rank them;
- Use Agile methodologies for Project Modelling, estimating the scope of your Project by depicting Epics, User Stories, User Story Mapping, MVP;
- Lead marketing analysis of competitive products on the market;
- Identify and manage business requirements using various methods of requirements analysis (interview, document analysis, requirements workshops) and tools (use cases, user stories).
- Translate high-level business and user requirements into specific feature requirements portrayed at the appropriate level of detail for IT;
- Turn hypothesis into a scenario so that IT can understand and implement a request from business;
- Support and management of the project processes in the JIRA Atlassian system, AZURE;
- Analyze existing business processes in the company, requests for changes, and clarify business requirements;
- Analyze business needs for process automation, prepare technical specifications, test and verify results;
- Describe the business and IT processes;
- Develop regulations for business end-users;
- Apply knowledge of SQL, BPMN, UML, JSON, REST API;
- Provide team management, process planning and distribution of development tasks (agile), execution control;
- Build billing;
- Connect ATM to a processing centre;
- Connect POS Terminal to a processing centre;
- Implement ERP in a manufacturing company;
- Administer specification and modelling of requirements;
- Project Management;
- Project Planning;

- Experience working in more than 5 KICKBOX startups that have passed RedBox, BlueBox and GoldBox as a business analyst and business consultant.

